    const [display, setDisplay] = useState(false);
    const [active, setActive] = useState(false);
    const data = "english"

    if (display) {
        return (
                <FunctionUI
                    leng={data}
                    setDisplay={setDisplay}
                    display={display}
                />
        )
    } else {
        return <>
            <Nav
                active={active}
                setActive={setActive}
                setDisplay={setDisplay}
